Coronado Springs Resort- Our favorite theming of all of the moderate resorts. This Spanish, Mexican, South American themed resort is one beautiful place to stay on your Walt Disney World vacation. 

This is a great resort if you want a semi all-adult hotel experience. This hotel usually holds many conferences, resulting in more adults being present. Like Caribbean Beach, this resort offers table service restaurants such as Rix Sports Bar and Grill, Three Bridges Bar and Grill and Maya Grill. So yes, there is a bit of nightlife activities included in the resort. 

In addition to the Coronado Springs rooms, the Gran Destino Tower is a brand new addition to the resort adding even more sit down restaurants! We haven‚Äôt had the chance to visit this tower yet but plan too soon and of course will share the details. 

This resort offers the the option of a king size bed or 2 queens. All rooms also include double sink bathrooms. 

Oh yeah! and make sure to check out the awesome pool designed to look like the Lost City of Cibola with an huge pyramid and waterslide!

You have to check this resort out!!!!

